import React from 'react'
import { Outlet } from 'react-router-dom'

function UsersProfile() {
  return (
    <div>

      <NavLink className="fs-4 text-white text-decoration-none ab text-center" to={`/usersprofile/articles`} >View Articles</NavLink>
      <Outlet/>
    </div>
  )
}

export default UsersProfile
